WOWOW!! 😳 One moment this water hole was empty, calm, and quiet WHEN ALL OF A SUDDEN through the bushes marched a parade of Elephants!! 🐘🐘🐘 Fun Facts : A group of Lions is called a Pride. A group of Baboons is called a Troop. And a group of elephants is called a Parade! 🐘🐘🐘 ps. The Bucket List Backpack launches in 10 days on @thebucketliststudios ❤️💙💚
