/// @africanbushcamps @mavrossafaris @dorothygee

GARRETT PUT ON A BRAVE FACE FOR THIS ONE!! ..kinda 😅😨😉 Anyone who knows Garrett knows he is TERRIFIED of heights. 😬😬😬 But Garrett knew he needed to put on a brave face to help Manilla. IM PROUD OF YOU BOYS!! Ummmm girls next?? 😳 
