/// @wildhorizonsvicfalls @matetsivictoriafalls

These photos bring me to tears.. Not just the beautiful moment with the giraffes, but the story behind the scenes..I look up to my “little” girl Dorothy so much. But she’s quickly becoming not so little and sometimes I worry she is outgrowing me and my influence as her mother. I know it sounds silly, but she started wearing my same socks on this trip and it kinda breaks my heart. BUT on this day, I was feeding 2 giraffes at the same time. I didn’t realize Dorothy was watching me until she asked Garrett, “Can I be brave like mommy and feed 2 giraffes at the same time?” That’s all..That’s the story that has me like 😢🥰😭😘🥰
/// #bucketlist #family #kenya #africa #giraffemanor
/// @thesafaricollection @dorothygee @thebucketlistfamily ketlistfamily.com/contact

Every morning is a race to see the giraffes 1st.. Dorothy has the age and size advantage, Manilla clearly has the strategy😉, BUT Cali seems to have the drive!! ❤️💙💚
